import "../App.css";

const HomePage = () => {
  return (
    <div className="homepage">
      {/* Hero Section */}
      <div className="hero-section fullwidth">
        <h1>Make Memories at the Perfect Venue</h1>
        <p>Find the ideal space for weddings, parties, and events.</p>
        <Link to="/login" className="hero-btn">Login</Link>
      </div>

      {/* Features Section */}
      <section className="features fullwidth">
        <div className="feature">
          <div className="feature-image"></div>
          <h3>Wide Range of Venues</h3>
          <p>Banquet halls, gardens, and more.</p>
        </div>
        <div className="feature">
          <div className="feature-image"></div>
          <h3>Transparent Pricing</h3>
          <p>Budget-friendly and value-for-money options.</p>
        </div>
        <div className="feature">
          <div className="feature-image"></div>
          <h3>24/7 Support</h3>
          <p>Expert guidance whenever you need it.</p>
        </div>
      </section>

      <footer>
        <p>Â© 2024 Mahal Booking - Your Event, Our Priority</p>
      </footer>
    </div>
  );
};

export default HomePage;
